window.bookSummaryJSON = "<p>My world was rock solid. </p> <p><b>Until I saw her.</b></p> <p>Lara Kessler showed up as if heaven sent her to me, and suddenly my priorities changed. Love is funny like that. One minute you’re living the dream, then BAM! Half my soul shows up backstage wearing a purple shirt and sexy skin-tight jeans, making me realize what I’ve been missing all along. Loving her means exposing a life I’ve tried to bury. </p> <p>My heart had lost its beat.</p> <p><b>Until I saw him.</b></p> <p>Kaz Fabian caught my attention the moment I laid eyes on him. Love is funny like that. The famous guitarist was every woman’s fantasy - great face, chiseled jaw, cut biceps. The rock star was pure sex on and off stage, but his charm and charisma won me over. Loving him means burdening him with a life I’ve tried to leave behind. </p> <p>With her future dim and his past in the spotlight, can they overcome their fate or will they just be another tragic love story?</p>"; 
